import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import impulse_logo from '../assets/impulse_left.png'

class Navbar2 extends Component {
    state = {  }
    render() { 
        return ( 
            <nav style={{backgroundColor:'#3D506B', height:'50px'}} className="navbar navbar-expand-sm">
                <a className="navbar-brand">
                    <img style={{height:'100px',width:'300px'}} src={impulse_logo}/>
                </a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse justify-content-center" id="navbarNav">
                    <ul className="navbar-nav">
                        <li className="nav-item active">
                            <a className="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Features</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Pricing</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
                        </li>
                    </ul>
                </div>
            </nav>
         );
    }
}

export default Navbar2;
